Actionscript.script:
_parent.UpdateBigSmallState("技能中","瞬步斩一段中");

if(_parent.mp >= _parent.mp满血值)
{
	mp溢出 = _parent.mp - _parent.mp满血值;
	_parent.mp -= mp溢出;
	_root.主角mp显示界面.刷新显示();
}
else
{
	mp溢出 = 0;
}

onClipEvent (load) {
	if (_parent._parent.技能名 == "狂瀑扎")
	{
		子弹属性 = _root.子弹属性初始化(this);

		//以下部分只需要更改需要更改的属性,其余部分可注释掉
		子弹属性.声音 = "狂瀑扎.wav";
		子弹属性.霰弹值 = 1;
		子弹属性.子弹散射度 = 0;
		子弹属性.子弹种类 = "狂瀑扎子弹";

		自机 = _root.获得父节点(this, 2);
		子弹属性.子弹威力 = 自机.空手攻击力 * 0.1 + 自机.等级 * 25 + 自机.刀属性.power * 4;

		子弹属性.子弹速度 = 30;
		子弹属性.Z轴攻击范围 = 60;
		子弹属性.击倒率 = 1;
		子弹属性.水平击退速度 = 18;
		子弹属性.伤害类型 = "魔法";

		_root.子弹区域shoot传递(子弹属性);
	}
}

if (!_parent.回归枢机之光发射数)
{
	_parent.回归枢机之光发射数 = 0;
}
_parent.回归枢机之光发射数 ++;

if (_parent.性别 == "男")
{
	_root.播放音效("登上明星人声.wav");
}else{
	_root.播放音效("登上明星女声.wav");
}

onClipEvent (load) {
	子弹属性 = _root.子弹属性初始化(this);

	//以下部分只需要更改需要更改的属性,其余部分可注释掉
	子弹属性.声音 = "";
	子弹属性.霰弹值 = 1;
	子弹属性.子弹散射度 = 0;
	子弹属性.子弹种类 = "近战子弹";

	自机 = _root.获得父节点(this, 2);
	子弹属性.子弹威力 = 自机.空手攻击力 * 0.1 + 自机.等级 * 25 + 自机.刀属性.power * 4;

	子弹属性.子弹速度 = 0;
	子弹属性.Z轴攻击范围 = 30;
	子弹属性.击倒率 = 10;

	子弹属性.区域定位area = this.area;
