onClipEvent (load) {
	if (_parent._parent.刀 != "")
	{
		_parent._parent.根据模式重新读取武器加成("兵器");
	}
	this.onUnload = function()
	{
		if (_parent._parent.状态 == "技能")
		{
			_parent._parent.根据模式重新读取武器加成("空手");
		}
		else if (_parent._parent.攻击模式 != "")
		{
			_parent._parent.根据模式重新读取武器加成(_parent._parent.攻击模式);
		}
	};
}

onClipEvent(enterFrame){
   _parent.攻击时移动(-20 * (1 + 1 / 10),-20 * (1 + 1 / 10));
}
onClipEvent(load){
   if(Key.isDown(_parent._parent.上键))
   {
      _parent.上下跳移动方向 = "上";
      _parent.gotoAndPlay("战技上下跳");
   }
   else if(Key.isDown(_parent._parent.下键))
   {
      _parent.上下跳移动方向 = "下";
      _parent.gotoAndPlay("战技上下跳");
   }
   if(_parent._parent.方向 == "右")
   {
      if(Key.isDown(_parent._parent.右键) == true)
      {
         _parent.gotoAndPlay("战技前跳");
      }
   }
   else if(_parent._parent.方向 == "左")
   {
      if(Key.isDown(_parent._parent.左键) == true)
      {
         _parent.gotoAndPlay("战技前跳");
      }
   }
}

onClipEvent(enterFrame){
	if(!_parent.上下跳移动方向){
		if(random(2)==0){
			_parent.上下跳移动方向 = "上";
		}else{
			_parent.上下跳移动方向 = "下";
		}
	}
   _parent._parent.移动(_parent.上下跳移动方向,10 * (1 + 1 / 10));
   _parent.攻击时移动(0,10 * (1 + 1 / 10));
}

